        background: #efefef;
        position: absolute;
        top: 0;
        bottom: 0;
        right: 0;
        left: 0;
        opacity: 0;
        transition: all 0.3s ease-in-out;
        overflow: hidden;
        &:hover {
          opacity: 0.9;
          color: black;
          .project-info {
            .project-details {
              transform: translate3d(0, 0, 0);
              opacity: 1;
            }
            .project-title {
              transform: translate3d(0, 0, 0);
              opacity: 1;
            }
          }
        }
        .project-info {
          padding: 56px;
