            position: relative;
            margin: 0 0 1rem 0;
            transform: translate3d(-100px, 0, 0);
            opacity: 0;
            transition: transform 0.5s ease-in-out;
          }
          .project-title {
            font-size: 1.8rem;
            text-transform: uppercase;
            font-weight: 500;
            transform: translate3d(-100px, 0, 0);
            opacity: 0;
            transition: transform 0.6s ease-in-out 0.1s;
          }
          .fas {
            position: absolute;
            bottom: 70px;
            right: 40px;
            font-size: 2.5rem;
          }
        }
      }

      p {
        font-weight: 300;
