@import "resume";
@import "infosection";
@import "workland";
@import "emails";
@import "webapps";
@import "landing";
@import "contact";

* {
  box-sizing: border-box;
}

body,
body {
  font-size: 18px;
  height: 100%;
  background: $color1;
  font-family: "Barlow Condensed";
}
.menu-icon {
  position: fixed;
  right: 36px;
  top: 36px;
  padding: 20px;
  z-index: 11;

  .fas {
    font-size: 2rem;
    color: $color1;
  }
}
.primary-btn {
  background: $color1;
  color: white;
  -webkit-border-radius: 20px;
  -moz-border-radius: 20px;
  border-radius: 20px;
  text-align: center;
  padding: 15px 30px;
  text-transform: uppercase;
  display: inline-block;
  letter-spacing: 4px;
  width: 200px;
  margin-right: 15px;
  text-decoration: none;
  transition: all 0.5s ease-in-out;
  &:hover {
    background: $hoverColor;
  }
}
.ghost-btn {
  -webkit-border-radius: 20px;
  -moz-border-radius: 20px;
  border-radius: 20px;
  border: 4px solid $color1;
  text-align: center;
  padding: 11px 26px;
  text-transform: uppercase;
  display: inline-block;
  letter-spacing: 4px;
  width: 200px;
  text-decoration: none;
  color: $color2;
  transition: all 0.5s ease-in-out;
  margin-bottom: 20px;
  margin-right: 10px;
  &:hover {
    border-color: $hoverColor;
  }
}

